<!DOCTYPE html>
<html>
<head>
	<meta charset="utf-8">
	<meta http-equiv="X-UA-Compatible" content="IE=edge">
	<title>GalleryAnim</title>
	<link href="https://fonts.googleapis.com/css?family=Open+Sans:300,700" rel="stylesheet">
	<style>
		html, body {
			padding: 0;
		    margin: 0;
		    width: 100vw;
		    height: 100vh;
		    overflow: hidden;
		    display: flex;
		    align-items: center;
		    justify-content: center;
		    font-size: 16px;
		    font-family: 'Open Sans', sans-serif;
		    letter-spacing: .5px;
		    line-height: 1;
		    color: white;
		}
		.frame {
			width: 400px;
			height: 400px;
			border-radius: 2px;
			box-shadow: 0px 0px 16px 0 rgba(0,0,0,0.2);
			background-color: #fff;
  			color: #fff;
  			display: flex;
		    align-items: center;
		    justify-content: center;
		    padding: 6px;
		}
		.gallery {
			width: 100%;
		    height: 100%;
		    display: flex;
		    background-color: white;
		    flex-wrap: wrap;
		}
		.gallery-item {
			width: 125px;
		    height: 125px;
		    background-color: #514e75;	
		    cursor: pointer;	
		    transition: all .6s;
		    transition-timing-function: ease-out;
		    padding: .6rem;
		}
		.gallery-item:nth-of-type(3n+1), .gallery-item:nth-of-type(3n+2) {
		    margin: 0px 6px 6px 0px;
		}
		.gallery-item:nth-of-type(3n+3) {
		    margin: 0px 0px 6px 0px;
		}
		.gallery-item:nth-of-type(7),.gallery-item:nth-of-type(8),.gallery-item:nth-of-type(9) {
			margin-bottom: 0;
		}
		.gallery-item.active {
			transform: scale(3.104);
		}

		.gallery-item:nth-of-type(1) {
			transform-origin: left top;
		}
		.gallery-item:nth-of-type(2) {
			transform-origin: center top;
		}
		.gallery-item:nth-of-type(3) {
			transform-origin: right top;
		}
		.gallery-item:nth-of-type(4) {
			transform-origin: left center;
		}
		.gallery-item:nth-of-type(5) {
			transform-origin: center;
		}
		.gallery-item:nth-of-type(6) {
			transform-origin: center right;
		}
		.gallery-item:nth-of-type(7) {
			transform-origin: left bottom;
		}
		.gallery-item:nth-of-type(8) {
			transform-origin: center bottom;
		}
		.gallery-item:nth-of-type(9) {
			transform-origin: right bottom;
		}
		.gallery-item svg {
			width: 100%;
		    height: 100%;
		    object-fit: contain;
		}
		* {
			box-sizing: border-box;
		}
	</style>
